import React from 'react';




const Users = () => {


    useEffect(() => {
        const userDetails = JSON.parse(localStorage.getItem('subscribers'));
        return () => {
            cleanup
        }
    }, [input])

    return (
        <>
            <div className="w-75 m-auto p-4">
                <h3>Users Registered</h3>
                <div className="table-responsive">
                    <table className="table table-striped table-hover">
                        <thead className="thead-dark">
                            <tr>
                                <th>S.No.</th>
                                <th>Firstname</th>
                                <th>Lastname</th>
                                <th>Email</th>
                            </tr>
                        </thead>
                        <tbody>
                            {

                                Object.entries(userDetails).map((val, ind) => {
                                    return (
                                        <tr key={ind}>
                                            <td>{ind + 1}</td>
                                            <td>{val[1].name}</td>
                                            <td>{val[1].email}</td>
                                            <td>{val[1].subject}</td>
                                        </tr>
                                    )

                                })



                            }

                        </tbody>
                    </table>
                </div>
            </div>

        </>
    )
}

export default Users
